import logo from "./logo.svg";
import React from "react";
import "./App.css";

const App = () => {
  const todoList = [
    { name: "Test React tool", status: "todo" },
    { name: "Write about Ant Design", status: "todo" },
    { name: "Finalize presentation", status: "todo" },
    { name: "Book flight to VN", status: "todo" },
  ];

  const onActive = (e, name) => {
    console.log("status", e.target.checked, name);
  };
  return (
    <div>
      <link
        rel="stylesheet"
        href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css"
      ></link>
      <div style={{ display: "flex", flexDirection: "row" }}>
        <input />
        <button type="button">Add</button>
      </div>
      {todoList.map((list) => (
        <div style={{ display: "flex", flexDirection: "row" }}>
          <input
            type="checkbox"
            value={list}
            onClick={(value) => onActive(value, list.name)}
          ></input>
          <div>{list.name}</div>
          <button class="btn">
            <i class="fa fa-trash"></i>
          </button>
        </div>
      ))}
    </div>
  );
};

export default App;
